import React, { useEffect, useState } from 'react'
import './ExploredMenu.css'
const ExploredMenu = () => {
  const [listPopular, addListPopular] = useState([]);
  useEffect(()=>{
    fetch('popular.json')
    .then(response => response.json())
    .then(data => addListPopular(data))
    .catch(error => console.log("Error", error))
  })
  return (
    <div className='exploredMenu'>
        <h3><span className='title'>Most Popular </span><span className='title2'>Right Now</span></h3>
        <div className='list-menu-popular'>
            {
              listPopular.map((game) => {
                (
                  <div className='item'>
                    {game.img}
                    {game.id}
                  </div>
                )
              })
            }
        </div>
    </div>
  )
}

export default ExploredMenu
